import "./Expenses.css";

function Expenses(props) {
  return (
    <div>
      <ExpenseItem expense={expensesList[0]} />
      <ExpenseItem expense={expensesList[1]} />
      <ExpenseItem expense={expensesList[2]} />
      <ExpenseItem expense={expensesList[3]} />
    </div>
  );
}

export default Expenses;
